DROP TABLE IF EXISTS `rally_points`;
DROP TABLE IF EXISTS `rallypoints`;
CREATE TABLE `rallypoints` (
  `Id` smallint unsigned NOT NULL DEFAULT '0',
  `CreatureId` int unsigned DEFAULT NULL,
  `Name` text,
  `ZoneID` smallint unsigned DEFAULT NULL,
  `WorldX` int unsigned DEFAULT NULL,
  `WorldY` int unsigned DEFAULT NULL,
  `WorldZ` smallint unsigned DEFAULT NULL,
  `WorldO` smallint unsigned DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

